    ///   - [`license_model(impl Into<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::license_model) / [`set_license_model(Option<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_license_model):<br>required: **false**<br><p>The license model information for this DB instance.</p> <p>This setting doesn't apply to Amazon Aurora or RDS Custom DB instances.</p> <p>Valid Values:</p> <ul>  <li>   <p>RDS for Db2 - <code>bring-your-own-license</code></p></li>  <li>   <p>RDS for MariaDB - <code>general-public-license</code></p></li>  <li>   <p>RDS for Microsoft SQL Server - <code>license-included</code></p></li>  <li>   <p>RDS for MySQL - <code>general-public-license</code></p></li>  <li>   <p>RDS for Oracle - <code>bring-your-own-license | license-included</code></p></li>  <li>   <p>RDS for PostgreSQL - <code>postgresql-license</code></p></li> </ul><br>
    ///   - [`iops(i32)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::iops) / [`set_iops(Option<i32>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_iops):<br>required: **false**<br><p>The amount of Provisioned IOPS (input/output operations per second) to initially allocate for the DB instance. For information about valid IOPS values, see <a href="https://docs.aws.amazon.com/AmazonRDS/latest/UserGuide/CHAP_Storage.html">Amazon RDS DB instance storage</a> in the <i>Amazon RDS User Guide</i>.</p> <p>This setting doesn't apply to Amazon Aurora DB instances. Storage is managed by the DB cluster.</p> <p>Constraints:</p> <ul>  <li>   <p>For RDS for Db2, MariaDB, MySQL, Oracle, and PostgreSQL - Must be a multiple between .5 and 50 of the storage amount for the DB instance.</p></li>  <li>   <p>For RDS for SQL Server - Must be a multiple between 1 and 50 of the storage amount for the DB instance.</p></li> </ul><br>
    ///   - [`option_group_name(impl Into<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::option_group_name) / [`set_option_group_name(Option<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_option_group_name):<br>required: **false**<br><p>The option group to associate the DB instance with.</p> <p>Permanent options, such as the TDE option for Oracle Advanced Security TDE, can't be removed from an option group. Also, that option group can't be removed from a DB instance after it is associated with a DB instance.</p> <p>This setting doesn't apply to Amazon Aurora or RDS Custom DB instances.</p><br>
