    ///   - [`publicly_accessible(bool)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::publicly_accessible) / [`set_publicly_accessible(Option<bool>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_publicly_accessible):<br>required: **false**<br><p>Specifies whether the DB instance is publicly accessible.</p> <p>When the DB instance is publicly accessible, its Domain Name System (DNS) endpoint resolves to the private IP address from within the DB instance's virtual private cloud (VPC). It resolves to the public IP address from outside of the DB instance's VPC. Access to the DB instance is ultimately controlled by the security group it uses. That public access is not permitted if the security group assigned to the DB instance doesn't permit it.</p> <p>When the DB instance isn't publicly accessible, it is an internal DB instance with a DNS name that resolves to a private IP address.</p> <p>Default: The default behavior varies depending on whether <code>DBSubnetGroupName</code> is specified.</p> <p>If <code>DBSubnetGroupName</code> isn't specified, and <code>PubliclyAccessible</code> isn't specified, the following applies:</p> <ul>  <li>   <p>If the default VPC in the target Region doesn’t have an internet gateway attached to it, the DB instance is private.</p></li>  <li>   <p>If the default VPC in the target Region has an internet gateway attached to it, the DB instance is public.</p></li> </ul> <p>If <code>DBSubnetGroupName</code> is specified, and <code>PubliclyAccessible</code> isn't specified, the following applies:</p> <ul>  <li>   <p>If the subnets are part of a VPC that doesn’t have an internet gateway attached to it, the DB instance is private.</p></li>  <li>   <p>If the subnets are part of a VPC that has an internet gateway attached to it, the DB instance is public.</p></li> </ul><br>
