    ///   - [`domain_dns_ips(impl Into<String>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::domain_dns_ips) / [`set_domain_dns_ips(Option<Vec::<String>>)`](crate::operation::create_db_instance::builders::CreateDBInstanceFluentBuilder::set_domain_dns_ips):<br>required: **false**<br><p>The IPv4 DNS IP addresses of your primary and secondary Active Directory domain controllers.</p> <p>Constraints:</p> <ul>  <li>   <p>Two IP addresses must be provided. If there isn't a secondary domain controller, use the IP address of the primary domain controller for both entries in the list.</p></li> </ul> <p>Example: <code>123.124.125.126,234.235.236.237</code></p><br>
